    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1946.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and wildfires.
    Resource management is outlined; topics include grazing, haying, and fur harvesting.
    The public relations section of the report describes recreational uses and Refuge
    visitors. Items of interest and N-R forms are attached.",nt"license_title":
